import "./TaskLists.css";
import Done from "./Done";
import InProgress from "./InProgress";

const TaskList = () => {
  return (
    <div className="taskContainer">
      <div className="taskItems">
        <div className="taskPosition">TO DO</div>
        <div className="taskItem">
          <div className="taskDetails">
            <p>
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Quam
              dolorum nisi ab laboriosam recusandae fuga, nobis iste corrupti
            </p>
            <div className="taskName">SPACE TRAVEL</div>
            <h6>
              DEADLINE <span>27/2022</span>
            </h6>
          </div>
        </div>
      </div>
      <div className="taskItems">
        <div className="taskPosition">IN PROGRESS</div>
        <InProgress />
      </div>
      <div className="taskItems">
        <div className="taskPosition">DONE</div>
        <Done />
      </div>
    </div>
  );
};

export default TaskList;
